import React from "react";
import { Link } from "react-router-dom";
import LoginComp from "../components/LoginComp";

function Login() {
  return (
    <div>
      <LoginComp />
      <Link to="/dashboard">
        <div className="absolute bottom-40 left-2/3 text-white">
          <button className="w-32 h-12 bg-white bg-opacity-65 text-black rounded-2xl">Submit</button>
        </div>
      </Link>
    </div>
  );
}

export default Login;
